•Pertain to the maintenance of records that, in reasonable detail, accurately and fairly reflect the transactions and dispositions of the assets of the Company;
•Provide reasonable assurance that transactions are recorded as necessary to permit preparation of financial statements in accordance with GAAP;
•Provide reasonable assurance that receipts and expenditures of the Company are being made only in accordance with appropriate authorization of management and the Board; and
•Provide reasonable assurance regarding prevention or timely detection of unauthorized acquisition, use, or disposition of the Company’s assets that could have a material effect on the financial statements. As of the end of the Company’s 2023 fiscal year, management conducted an evaluation of the effectiveness of the Company’s internal control over financial reporting based on the framework established in Internal Control-Integrated Framework (2013) issued by the Committee of Sponsoring Organizations of the Treadway Commission (COSO). The Company’s system of internal control over financial reporting is designed to provide reasonable assurance to the Company’s management and Board regarding the reliability of financial records used in preparation of the Company’s published financial statements. As all internal control systems have inherent limitations, even systems determined to be effective can provide only reasonable assurance with respect to financial statement preparation and presentation. Based on its assessment, management has concluded that the Company’s internal control over financial reporting was effective as of December 31, 2023.
